import { MDBContainer, MDBNavbar, MDBNavbarBrand } from "mdb-react";
import { FC } from "react";
import Home from "./pages/Home";

const App: FC = () => {
	return (
		<div>
			<MDBNavbar dark bgColor="dark">
				<MDBContainer>
					<MDBNavbarBrand href="#">
						<img src="/favicon.ico" height="40" alt="Mega-Hackathon" loading="lazy" />
					</MDBNavbarBrand>
				</MDBContainer>
			</MDBNavbar>
			<Home />
		</div>
	);
};

export default App;
